#!perl
use warnings;
use strict;
use File::Basename;
use lib dirname(__FILE__);
use lib dirname(__FILE__) . "/lib";
use Gnu::Template qw(Template Usage);
use Gnu::ArgParse;
use Gnu::FileUtil qw(SlurpFile SpillFile);

MAIN:
   $| = 1;
   ArgBuild("^help");

   ArgParse(@ARGV) or die ArgGetError();
   ArgAddConfig() or die ArgGetError();
   Usage() if ArgIs("help") || !ArgIs();
   
   CreatePreviews();
   print "Done.\n";
   exit(0);


sub CreatePreviews
   {
   my $count = ArgIs();
   for (my $i=0; $i<$count; $i++)
      {
      map {CreatePreview($_)} (glob(ArgGet(undef, $i)));
      }
   }

sub CreatePreview
   {
   my ($file) = @_;

   my ($name, $type) = $file =~ /^(.+)\.(.+)$/;
   return print "Ignoring $file.\n" if $type !~ /xml/i;
   my $outfile = $name . ".html";
   print "Generating $outfile...\n";

   my $xml = SlurpFile($file);
   my $data = Template("html-template", xml=>$xml);
   SpillFile ($outfile, $data);
   }

__DATA__

[usage]
MakePreview.pl  -  Create Invoice Preview HTML files from xml files

USAGE: MakePreview.pl [xmlfile]...

WHERE: [xmlfile] is a list of invoice xml files

Examples:
   MakePreview.pl 5363780956.xml
   MakePreview.pl 5363780956.xml 8467393283.xml
   MakePreview.pl *.xml


